import React from 'react'

import './Appointment.css'

let availableTimes = [9, 10, 11]

export default function Appointment() {
  return (
    <table>
        <thead>
            <tr>
              <th>S</th>
            </tr>
        </thead>
        <tbody>
            {
                availableTimes.map((time: number, i: number): any => {
                    return <tr className='availableTimeBox'>
                        <th>
                            <button key={i}>
                                {time}
                            </button>
                            <button>
                                {time}
                            </button>
                        </th>
                    </tr>
                })
            }
        </tbody>
    </table>
  )
}
